import React from 'react';
import Layout from '../components/Layout';

const Contact = () => (
  <Layout hero={<h1>Contact Us</h1>}>
    <section>
      <h2>Get in touch</h2>
      <p>Email: <a href="mailto:hello@example.com">hello@example.com</a></p>
      <p>We'd love to hear from you! Reach out for new projects, partnerships, or just to say hi.</p>
    </section>
  </Layout>
);

export default Contact;
